import React, { useState } from 'react';
import Climb from '../Climb/Climb'
import './Dashboard.css';

function Dashboard() {

  const[values, setValues] = useState({
      username: '',
      gym: '',
      climbType: '',
      grade: '',
      rating: '',
  })

  const handleUsernameInputChange = (event) => {
      setValues({...values, username: event.target.value})
  }

  const handleGradeInputChange = (event) => {
      setValues({...values, grade: event.target.value})
  }

  const[submitted, setSubmitted] = useState(false)

  const handleSubmit = (event) => {

      setSubmitted(true);
  }

  return (
    <div className='dashboard-container'> 
      <div className='form-container'>
          <form className='form' onSubmit={handleSubmit}>
              {submitted ? <div className='success-message'>Success! Thanks for submitting your send!</div> : null}
              <h1 className='dash-title'>Submit a Send</h1>
              <input
                  onChange={handleUsernameInputChange}
                  value={values.username}
                  className='form-field'
                  type='text'
                  placeholder='Username'
                  name='username'
              />
              <select id='gym' className='form-field' name='gym'>
                  <option value='bkb-wl'>BKB West Loop</option>
                  <option value='bkb-lp'>BKB Lincoln Park</option>
                  <option value='fa-a'>FA Avondale</option>
              </select>
              <select id='climbType' className='form-field' name='climbType'>
                  <option value='boulder'>Boulder</option>
                  <option value='top-rope'>Top Rope</option>
                  <option value='lead'>Lead</option>
              </select>

              <input
                  onChange={handleGradeInputChange}
                  value={values.grade}
                  className='form-field'
                  type='text'
                  placeholder='Grade'
                  name='grade'
              />
              <select id='rating' className='form-field' name='rating'>
                  <option value='1-star'>1 Star</option>
                  <option value='2-stars'>2 Stars</option>
                  <option value='3-stars'>3 Stars</option>
                  <option value='4-stars'>4 Stars</option>
                  <option value='5-stars'>5 Stars</option>
              </select>

              <button class='form-field' type='submit'>
                  Submit
              </button>

          </form>
        </div>
        <div className='climb-list-container'>
          <h1 className='dash-title'>Recent Sends</h1>
          <div className='climb-list'></div>

        </div>
      </div>

  )
}

export default Dashboard;
